struct PIT_t {
	volatile unsigned int DR;
	volatile unsigned int DIR;
	volatile unsigned int MASK;
	volatile unsigned int EDGE;
};

struct timer_t {
	volatile unsigned int status;
	volatile unsigned int control;
	volatile unsigned int periodlo;
	volatile unsigned int periodhi;
	volatile unsigned int snaplo;
	volatile unsigned int snaphi;
};

 

struct timer_t * const timer = (struct timer_t *) 0xFF202000;
int laser_interval = 500000000;
int blink_interval = 50000000;
volatile int pixel_buffer_start; // global variable
short int Buffer1[240][512]; // 240 rows, 512 (320 + padding) columns
short int Buffer2[240][512];
struct PIT_t *ledp = ((struct PIT_t *) 0xFF200000);
struct PIT_t *buttonp = ((struct PIT_t *) 0xFF200050);
bool on_ground = true;
int row_of_coins[10][2];

void plot_pixel(int x, int y, short int line_color)
{
    volatile short int *one_pixel_address;
        
	one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);

	*one_pixel_address = line_color;
}

void draw_character(int x, int y){
	for(int sx = 0; sx < IMAGE_RESIZED_WIDTH; sx++){
		for(int sy = 0; sy < IMAGE_RESIZED_HEIGHT; sy++){
			if(character_mask[sy * IMAGE_RESIZED_WIDTH + sx]){
				plot_pixel(x+sx, y+sy, character[sy * IMAGE_RESIZED_WIDTH + sx]);
			}
		}
	}
}

void draw_fire(int fire_x, int fire_y){
	for(int x = 0; x < BLUE_FIRE_WIDTH; x++){
		for(int y = 0; y < BLUE_FIRE_HEIGHT; y++){
			if(blue_fire_gray[y * BLUE_FIRE_WIDTH + x] > 50){
				plot_pixel(fire_x + x - BLUE_FIRE_WIDTH/2, fire_y + y, blue_fire[y * BLUE_FIRE_WIDTH + x]);
			}
		}
	}
}

void draw_exclamation_mark(int laser_y){
	for(int x = 0; x < EXCLAMATION_MARK_RESIZED_WIDTH; x++){
		for(int y = 0; y < EXCLAMATION_MARK_RESIZED_HEIGHT; y++){
			if(exclamation_mark[y * EXCLAMATION_MARK_RESIZED_WIDTH + x] == 0x0){
				continue;
			}
			plot_pixel(x + 320 - EXCLAMATION_MARK_RESIZED_HEIGHT, laser_y - EXCLAMATION_MARK_RESIZED_HEIGHT/2 + y, exclamation_mark[y * EXCLAMATION_MARK_RESIZED_WIDTH + x]);
		}
	}
}

void draw_initial_screen(int screen_start_x){
  for(int x = 0; x < HOMESCREEN_1__WIDTH; x++){
    for(int y = 0; y < HOMESCREEN_1__HEIGHT; y++){
      plot_pixel(x, y, initial_screen[y * HOMESCREEN_1__WIDTH + (x+screen_start_x) % HOMESCREEN_1__WIDTH]);
    }
  }
}

void draw_background(int background_start_x){
	for(int x = 0; x < BACKGROUND_RESIZED_WIDTH; x++){
		for(int y = 0; y < BACKGROUND_RESIZED_HEIGHT; y++){
			plot_pixel(x, y, background[y * BACKGROUND_RESIZED_WIDTH + (x+background_start_x) % BACKGROUND_RESIZED_WIDTH]);
		}
	}
}

void draw_laser(int laser_y){
	for(int y = laser_y - 4; y <= laser_y + 4; y++){
		for(int x = 0; x < 320; x++){
			if(y < laser_y + 2 & y > laser_y - 2){
				plot_pixel(x, y, 0xffff);
			}
			else if(y == laser_y + 3 | y == laser_y - 3){
				plot_pixel(x, y, 0xfa8a);
			}
			else{
				plot_pixel(x, y, 0xfbcb);
			}
		}
	}
}

void draw_coin(int x, int y){
  for(int sx = 0; sx < COINS_WIDTH; sx++){
    for(int sy = 0; sy < COINS_HEIGHT; sy++){
      if(coins[sy * COINS_WIDTH + sx] == 0x0){
        continue;
      }
      plot_pixel(x+sx, y+sy, coins[sy * COINS_WIDTH + sx]);
    }
  }
}

void generate_row_of_coins(int y){
  for(int i = 0; i < 5; i++){
    row_of_coins[i][0] = 320 - ((5-i)*COINS_WIDTH);
    row_of_coins[i][1] = y;
  }
}

void wait_for_vsync(){
	volatile int* pixel_ctrl_ptr = (int *)0xff203020;
	int status;
	*pixel_ctrl_ptr = 1;
	status = *(pixel_ctrl_ptr+3);
	while((status&0x01)!=0){
		status = *(pixel_ctrl_ptr + 3);
	}
}

void clear_screen(){
	for(int x = 0; x < BACKGROUND_RESIZED_WIDTH; x++){
		for(int y = 0; y < BACKGROUND_RESIZED_HEIGHT; y++){
			plot_pixel(x, y, 0xffff);
		}
	}
}

int main(){
	volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
	*(pixel_ctrl_ptr + 1) = (int) &Buffer1;
	wait_for_vsync();
	pixel_buffer_start = *pixel_ctrl_ptr;
	clear_screen();
	*(pixel_ctrl_ptr + 1) = (int) &Buffer2;
	pixel_buffer_start = *(pixel_ctrl_ptr + 1);
	clear_screen();
  int coinCount = 0;

	
	int pos_y = GROUND - IMAGE_RESIZED_HEIGHT;
	int pos_x = 10;
	int background_start_x = 0;
	int dy = 0;
	timer->status = 0;
	timer->periodlo = laser_interval & 0xffff;
	timer->periodhi = (laser_interval & 0xffff0000) >> 16;
	timer->control = 0x4;
  buttonp->EDGE = 0x1;
	int laser_count = 3;
	int laser_loc[6] = {0,0,0,0,0,0};
	bool show_warning = false;
	bool shoot_laser = false;
	bool draw_laser_sig = false;
  int y = rand() % 220;
  generate_row_of_coins(y);
  //PS2 KEYBOARD
	unsigned char byte1 = 0;
	unsigned char byte2 = 0;
	unsigned char byte3 = 0;
  volatile int * PS2_ptr = (int *) 0xFF200100;  // PS/2 port address
	int PS2_data, RVALID;
	
	while(1){
    wait_for_vsync();
		while(buttonp->EDGE != 0x1){
			draw_initial_screen(background_start_x);
		}
		wait_for_vsync();
		draw_background(background_start_x);
		on_ground = (GROUND - IMAGE_RESIZED_HEIGHT == pos_y);
		if(!show_warning & (timer->status & 0x1)){
			timer->periodlo = blink_interval & 0xffff;
			timer->periodhi = (blink_interval & 0xffff0000) >> 16;
			timer->status = 0;
			timer->control = 0x4;
			show_warning = true;
			for(int i = 0; i < laser_count; i++){
				laser_loc[i] = rand() % 200;
			}
		}
		if(show_warning & !(timer->status & 0x1)){
			for(int i = 0; i < laser_count; i++){
				draw_exclamation_mark(laser_loc[i]);
			}
		}
		if(show_warning & (timer->status & 0x1)){
			timer->periodlo = 200000 & 0xffff;
			timer->periodhi = (200000 & 0xffff0000) >> 16;
			timer->status = 0;
			timer->control = 0x4;
			show_warning = false;
			draw_laser_sig = true;
		}
		if(draw_laser_sig & !(timer->status & 0x1)){
			for(int i = 0; i < laser_count; i++){
				draw_laser(laser_loc[i]);
			}
		}
		if(draw_laser_sig & (timer->status & 0x1)){
			draw_laser_sig = false;
			timer->periodlo = laser_interval & 0xffff;
			timer->periodhi = (laser_interval & 0xffff0000) >> 16;
			timer->status = 0;
			timer->control = 0x4;
		}
		
		PS2_data = *(PS2_ptr);	// read the Data register in the PS/2 port
		RVALID = (PS2_data & 0x8000);	// extract the RVALID field
		if (RVALID != 0)
		{
			/* always save the last three bytes received */
			byte1 = byte2;
			byte2 = byte3;
			byte3 = PS2_data & 0xFF;
		}

		
		if(byte3 == 0x29 && byte2 !=0xf0){
			if(dy < 0){
				dy = 1;
			}
			else{
				dy += 1;
			}
			dy+=1;
			if(pos_y - dy>=0){
				pos_y -= dy;
			}
		}
		else if(!on_ground && byte2 == 0xf0){
			if(dy > 0){
				dy = -1;
			}
			else{
				dy -= 1;
			}
			if(pos_y - dy < GROUND - IMAGE_RESIZED_HEIGHT){
				pos_y -= dy;
			} 
			else{
				pos_y = GROUND - IMAGE_RESIZED_HEIGHT;
			}
		}
		draw_character(pos_x, pos_y);
		if(dy > 0){
			draw_fire(pos_x + 10, pos_y + 30);
		}
    int y = rand() % 320; 
    for(int i = 0; i < 5; i++){
      draw_coin(row_of_coins[i][0], row_of_coins[i][1]);
      row_of_coins[i][0] -= 10;
	  if(pos_y == row_of_coins[i][1]){
		  coinCount++;
		  printf("COIN COUNT %d\n", coinCount);
	  }
    }
    if(row_of_coins[0][0] < 0){
      int newY = rand() % 220;
      generate_row_of_coins(newY);
    }
		wait_for_vsync();
		pixel_buffer_start = *(pixel_ctrl_ptr + 1);
		background_start_x+=10;
		if(background_start_x >= BACKGROUND_RESIZED_WIDTH){
			background_start_x = 0;
		} 
	}
}